from typing import Tuple

def is_rectangle_overlap(rect1: Tuple[int, int, int, int], rect2: Tuple[int, int, int, int]) -> bool:
    """"""
    (x1, y1, x2, y2) = rect1
    (a1, b1, a2, b2) = rect2
    if x2 < a1 or a2 < x1:
        return False
    if y1 < b2 or b1 < y2:
        return False
    return True
